import logo from '../logo.svg';
import '../App.css';
import {Route, Routes} from "react-router";
import Survey from "./Survey";

function Home() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Survey/>}/>

      </Routes>
    </div>
  );
}

export default Home;
